import React from 'react';
import Card from 'react-bootstrap/Card';

const CreateCard = () => {
    return(
        <Card border="primary" style={{ width: '12rem', height: '18rem' }}>
        <Card.Body>
          <Card.Text style={{ textAlign: "center", fontSize: "20px" }}>1</Card.Text>
        </Card.Body>
      </Card>
        )
}

export default CreateCard;
